window.bookSummaryJSON = "<p>Betrayed. Bereaved. Sarcastic and deadly.</p> <p>The God of Death curses Bib to kill and to love killing. He hates that he loves it. But he’s awfully good at it.</p> <p>So why can’t he kill the man who slaughters the people he’s been protecting? The slab-faced, baby-murdering sorcerer who outsmarts Bib and then rides away laughing - with a kidnapped prince, no less?</p> <p>If anybody deserves to die, it’s this ass-dragging jackal.</p> <p>Bib chases the villain by joining forces with the prince’s would-be rescuers. They’re glad for his help, but Bib just wants to murder the kidnapper. How will he handle his allies when they realize he’s using them - that he wouldn’t trade the bad part of a yak for the prince?</p> <p><i>Death’s Collector </i>is the first book in the darkly humorous Death-Cursed Wizard fantasy series. If you like snarky heroes, top-notch magic systems, and epic sword and sorcery, then you’ll love Bill McCurry’s addictive tale. Listen to <i>Death’s Collector </i>to flirt with darkness today!</p>"; 
